CREATE DEFINER=`root`@`localhost` PROCEDURE `gene_tissue`(in gene varchar(20),out count int,out fetalTf varchar(50),out dermTf varchar(50),out ttmTf varchar(50),out dsc varchar(200))
begin
declare id int;
select gene_id,description,fetal_special_tf,derm_special_tf,ttm_tf 
into id,dsc,fetalTf,dermTf,ttmTf from gene_symbol where gene_symbol=gene;
drop temporary table if exists gene_fot;
create temporary table gene_fot as(
select tissue_id,group_concat(fot) as fot from exp_fot where gene_id=id group by tissue_id);
select tissue_name,repetition,fot,mean,stdev,cv
from gene_fot join tissue on gene_fot.tissue_id=tissue.tissue_id join
(select tissue_id,mean,stdev,cv from exp_statis where gene_id=id) as statis on statis.tissue_id=gene_fot.tissue_id;
select count(*) into count from exp_statis where gene_id=id and mean!=0;
end ;;
