CREATE DEFINER=`root`@`localhost` PROCEDURE `tissue_gene`(in tissue varchar(50),in page int,out repeatNum int,out total int)
begin
declare id,dis int;
set dis=page*20; 
select tissue_id,repetition into id,repeatNum from tissue where tissue_name=tissue;
drop temporary table if exists tissue_fot;
create temporary table tissue_fot as(
select gene_id,group_concat(fot) as fot from exp_fot where tissue_id=id group by gene_id);
select gene_symbol,description,fot,mean 
from tissue_fot join gene_symbol on tissue_fot.gene_id=gene_symbol.gene_id join 
(select mean,gene_id from exp_statis where tissue_id=id) as mean on mean.gene_id=tissue_fot.gene_id
where mean!=0 limit 20 offset dis;
select count(*) into total from exp_statis where tissue_id=id and mean!=0; 
end ;;
